import {useEffect, useState} from "react";

export default function Order() {
    const [order, setOrders] = useState([]);

    const orders = () =>{
        fetch("/order/get")
            .then(orders => orders.json())
            .then(orders => setOrders(orders))
    }

    useEffect(() => {
        orders()
    }, [])

    return(
        <>
        <div className="order">
            <p>{order[0].name}</p>

        </div>
        </>
    )
}
